package com.example.e440.menu.wally_original;

import androidx.lifecycle.LiveData;
import androidx.lifecycle.MutableLiveData;

import java.lang.reflect.Array;
import java.util.ArrayList;

public class ViewModel extends androidx.lifecycle.ViewModel {
    private final ArrayList<ItemAnswer> answers = new ArrayList<ItemAnswer>();

    private int currentItemIndex = 0;

    ArrayList<WallyOriginalItem> items = new ArrayList<>();

    public void insertAnswer(ItemAnswer answer, int index){
        answers.set(index, answer);
    }

    public WallyOriginalItem GetItem(int index){

        return items.get(index);
    }

    public void IncrementCurrentItemIndex(){
        currentItemIndex++;
    }


    public void DecrementCurrentItemIndex(){

        currentItemIndex--;
    }

    public boolean CurrentItemIsFirstItem(){
        return GetCurrentItem() == items.get(0);
    }

    public boolean CurrentItemIsLastItem(){

        return GetCurrentItem() == items.get(items.size()-1);
    }

    public WallyOriginalItem GetCurrentItem(){
        return items.get(GetCurrentItemIndex());

    }
    public int getItemsCount(){
     return items.size();
    }


    public void LoadItems(){
        items.add( new WallyOriginalItem(
                "Supongamos que le pides a una amiga que juegue contigo y ella dice que no. ¿Qué harías?",
                "data:image/jpeg;base64,",
                1));
        items.add( new WallyOriginalItem(
                "Supongamos que rompiste el jarrón favorito de tu mamá/papá. ¿Qué harías?",
                "data:image/jpeg;base64,",
                2));
        items.add( new WallyOriginalItem(
                "Supongamos que tu hermana comenzó a molestarte y tú comenzaste a molestarla a ella también, luego tu mamá/papá te manda a tu pieza . ¿Qué harías?",
                "data:image/jpeg;base64,",
                3));

        items.add( new WallyOriginalItem(
                "Supongamos que otro niño en el colegio/jardín te molesta y se burla constantemente de ti. ¿Qué harías?",
                "data:image/jpeg;base64,",
                4));

        items.add( new WallyOriginalItem(
                "Supongamos que realmente quieres un juguete de la tienda pero tu papá/mamá no te " +
                        "lo quiere comprar. ¿Qué harías?",
                "data:image/jpeg;base64,",
                5));

        items.add( new WallyOriginalItem(
                "Supongamos que acabas de romper los pantalones nuevos que tu mamá/papá te " +
                        "compró para una situación especial. ¿Qué harías?",
                "data:image/jpeg;base64,",
                6));

        items.add( new WallyOriginalItem(
                "Supongamos que otra niña te llama bebé porque juegas a las muñecas. ¿Qué harías?",
                "data:image/jpeg;base64,",
                7));
    }

    public int GetCurrentItemIndex() {
        return currentItemIndex;
    }

    public void setCurrentItemIndex(int currentItemIndex) {
        this.currentItemIndex = currentItemIndex;
    }


    public ItemAnswer getAnswer(int index){

        try{
            answers.get(index);
        }catch(IndexOutOfBoundsException e){

            ItemAnswer itemAnswer = new ItemAnswer();
            answers.add(itemAnswer);
        }

        return answers.get(index);
    }


}
